import { createReducer } from "../../utils/store"

const defaultProps = {}
let window = window || null

if (window) {
  defaultProps.windowInnerHeight = window.innerHeight
  defaultProps.windowInnerWidth = window.innerWidth
}

export default createReducer(defaultProps, {})
